import React, {useState, useEffect} from 'react';
import '../../src/App.css'
import { BrowserRouter as Router, Route, Routes, Link, useLocation } from 'react-router-dom';
import axios from 'axios';
import Map from 'react-map-gl';


const Explore = () => {
    const [events, setEvents] = useState([]);

    useEffect(() => {
      const fetchData = async () => {
        try {
          const response = await fetch('http://localhost:8000/api/getEvents');
          const data = await response.json();
          setEvents(data.data);
        } catch (error) {
          console.error('Error fetching data:', error);
        }
      };

      fetchData();
    }, []);

    return (
        <div>
        <h1>Event List</h1>

        <div class="events-top-comp">
        <ul className='events-section-2'>
          {events.map(event => (
            <>
            <li className='event-lists' key={event._id}>
              <strong>Event Name:</strong> {event.eventName},{' '}
              <strong>Location:</strong> {event.location},{' '}
              <strong>Start Date:</strong> {new Date(event.startDate).toLocaleString()},{' '}
              <strong>End Date:</strong> {event.endDate ? new Date(event.endDate).toLocaleString() : 'N/A'}
            </li>
          <hr className='line-comp' />
            </>
          ))}
        </ul>

        <Map
      mapboxAccessToken="pk.eyJ1IjoiZGVpb25zdGZsZXVyIiwiYSI6ImNscTFoZ21uejA4bmgyam1xc2Y5MmFwc2MifQ.1jezNRykcGiitrVZfkdrDQ"
      initialViewState={{
        longitude: -122.4,
        latitude: 37.8,
        zoom: 14
      }}
      style={{}}
      mapStyle="mapbox://styles/mapbox/streets-v9"
    />
        </div>
      </div>
    )

};

export default Explore;
